def mainview(request) :
    tpl = loader.get_template('viewjp/mainview.html')
    ctx = RequestContext(request, {})
    return HttpResponse(tpl.render(ctx))

def viewText(request, number=1):
    entries = Text.objects.get(textNumber = number)
    
    parsedText = re.findall('f...|..', entries.hexString)
    text = jpcapProcess(parsedText)
    
    choosedTextNumber = -1
    
    translatedText = callTextlist(number)
    
    for z in range(len(translatedText)):
        if translatedText[z].choosed == True :
            choosedTextNumber = z
            break;
    
    choosedText = []
    
    if not choosedTextNumber == -1 :
        choosedText = unicodetoSatext(translatedText[z].Contents)    

    tpl = loader.get_template('viewjp/viewjp.html')
    ctx = RequestContext(request, {'text':text, 'list':parsedText, 'number':number, 'translatedText':translatedText, 'choosedText':choosedText})
    return HttpResponse(tpl.render(ctx))

def callTextlist(number):
    entries = translateText.objects.filter(textNumber = int(number)).order_by('-transDate')
    
    return entries

def chooseTranslated(request):
    if request.user.is_authenticated():
        req_translateNumber = request.POST.get('translatedNumber')
        req_textNumber = request.POST.get('textNumber')
        
        translateText.objects.filter(textNumber = req_textNumber).update(choosed = False)
        
        entry = translateText.objects.get(id = req_translateNumber)
        entry.choosed = True
        
        entry_text = Text.objects.get(id = req_textNumber)
        entry_text.translatedNumber = req_translateNumber
        
        entry.save()
        entry_text.save()
        
    return redirect('/surgingaura/viewtext/' + req_textNumber)
        
def unchooseTranslated(request):
    if request.user.is_authenticated():    
        req_textNumber = request.POST.get('textNumber')
        
        translateText.objects.filter(textNumber = req_textNumber).update(choosed = False)

        entry_text = Text.objects.get(id = req_textNumber)
        entry_text.translatedNumber = 0
        entry_text.save()
    
    return redirect('/surgingaura/viewtext/' + req_textNumber)

def delTranslated(request):
    if request.user.is_authenticated():    
        req_translateNumber = request.POST.get('translatedNumber')
        req_textNumber = request.POST.get('textNumber')
        
        entry_text = Text.objects.get(id = req_textNumber )
        if entry_text.translatedNumber == int(req_translateNumber) :
            return redirect('/surgingaura/viewtext/' + req_textNumber)
        
        translateText.objects.get(id = req_translateNumber).delete()
        
        entry_text.numofText = entry_text.numofText - 1
        entry_text.save()


    return redirect('/surgingaura/viewtext/' + req_textNumber)

def viewList(request, page=1):
    entries = Text.objects.all()
    paginator = Paginator(entries, 50)
    
    try:
        currentPage = paginator.page(page)
    except PageNotAnInteger:
        # If page is not an integer, deliver first page.
        currentPage = paginator.page(1)
    except EmptyPage:
        # If page is out of range (e.g. 9999), deliver last page of results.
        currentPage = paginator.page(paginator.num_pages)
    
    return render_to_response('viewjp/listview.html', {"currentpage": currentPage})

def unicodetoSatext(translatedText):
    translatedText = ("%04x" % (int(translatedText.encode("euc-kr").encode("hex"), 16)))
    translatedText = re.findall("(7b28..297d|[b-c].[a-f].|[0-99].)", translatedText)
    translatedText = textcodeConverter(translatedText)
    
    z = 0
        
    while True:
        if len(translatedText[z]) == 4:
            t = re.findall("(..)", "%04x" % (int(translatedText[z], 16) - 0xb0a0))
            t2 = (int(t[0], 16) * 94) + (int(t[1], 16) - 1) + 61440
            translatedText[z] = "%04x" % t2
    
        z = z + 1
    
        if len(translatedText) <= z:
            break
        
    return translatedText

def allList(request):
    translatedCount = translateText.objects.filter(choosed = True).count()
    translatedProgress = round(float(translatedCount) / 1685 * 100, 3)
    
    entry_text = Text.objects.all()
   
    return render_to_response('viewjp/alllist.html', { "entry_text":entry_text, "translatedProgress":translatedProgress })

def jpcapProcess(list):
    jpcapFlag = ""
    
    completeList = []
    lineList = []
    
    z = 0
    lineLength = 0

    while z < len(list) : 
        if list[z] == '03':
            jpcapFlag = ""
            
        elif list[z] == '04':
            jpcapFlag = "_"

        elif list[z] == '0d' or list[z] == '00':
            lineLength = 0
            completeList.append(lineList[:])
            del lineList[:]
            
        elif list[z] == '0c' or list[z] == '0f':
            pass
        
 
        else :
            if list[z] >= '60' :
                lineList.append(jpcapFlag + list[z])
                lineLength = lineLength + 1
            elif list[z] < '60' :
                lineList.append(list[z])
                lineLength = lineLength + 1
            
            
            if lineLength > 15:
                lineLength = 0
                completeList.append(lineList[:])
                del lineList[:]   
                 
        z = z + 1
        
    return completeList

def translatePost(request):
    text = request.POST.get('translateText')
    number = request.POST.get('number')
    author = request.POST.get('author')
    if len(author) == 0 :
        author = "Anonymous"
    if len(text) == 0 :
        return redirect('/surgingaura/viewtext/' + number)
    if len(number) == 0 :
        return redirect('/surgingaura/viewtext/' + number)     
    
    translatedText = translateText(textNumber=number, Contents=text, userID=author)
    translatedText.save()
    
    entry_text = Text.objects.get(id = number)
    entry_text.numofText = entry_text.numofText + 1
    entry_text.save()
    
    return redirect('/surgingaura/viewtext/' + number)

def downloadFullIps(request):
    patchList = []
    patchList.append('\x50\x41\x54\x43\x48')
    patchList.append(initializeIps())
    patchList.append(translatedTexttoIps())
    patchList.append('\x45\x4f\x46')
    patchList = "".join(patchList)
    
    ips = StringIO()
    ips.write(patchList)
    
    response = HttpResponse(mimetype="application/ips")
    response["Content-Disposition"] = "attachment; filename=sao.ips"
    
    response.write(ips.getvalue())
    
    return response

def textcodeConverter(textList):
    z = 0
    
    while z < len(textList):
        if re.match("7b28..297d", textList[z]):
            textList[z] = hash[textList[z]]
        
        z = z + 1
        
    return textList

def modifyTextPointer(entry, newTextStartPos):
    patchList = []
    
    textPtr = "%06x" % entry.textPos
    textLength = "\x00\x03"
        
    patchList.append(unhexlify(textPtr))
    patchList.append(textLength)
    patchList.append(unhexlify(newTextStartPos))
    
    return "".join(patchList)

def appendTranslatedText(entry, newTextStartPos):
    patchList = []
       
    textList = unicodetoSatext(entry.Contents)
    textLength = translatedLength(textList) + 5
    
    fullTextLength = ("%06x" % (int(newTextStartPos, 16) + textLength))
    textPrefix = "1700" + fullTextLength
    
    patchList.append(unhexlify(newTextStartPos))    
    patchList.append(unhexlify("%04x" % textLength))
    patchList.append(unhexlify(textPrefix))
    patchList.append(unhexlify("".join(textList)))
    
    return "".join(patchList)

def translatedLength(textList):
    return len(re.findall("..", "".join(textList)))

def translatedTexttoIps():
    
    newTextStartPos = "230000"
    patchList = []
    
    entries = translateText.objects.filter(choosed = True)

    for z in entries:
        entries2 = Text.objects.get(textNumber = z.textNumber)
        patchList.append(modifyTextPointer(entries2, newTextStartPos))
        
        textList = appendTranslatedText(z, newTextStartPos)
        patchList.append(textList)
        
        textLength = translatedLength(unicodetoSatext(z.Contents)) + 5
        
        newTextStartPos = "%06x" % (int(newTextStartPos, 16) + textLength)
        
    patchList = "".join(patchList)
    
    return patchList
    
def initializeIps():
    patchList = []
    
    patchList.append('\x06\x82\x5d') #한자 위치를 가리키는 주소
    patchList.append('\x00\x03') # 길이
    patchList.append('\x20\x00\x00') # 새로운 주소의 값
    
    patchList.append('\x20\x00\x00') # 추가되는 폰트의 위치
    patchList.append('\xff\xff') # 추가되는 폰트의 길이
    patchList.append(unhexlify(""))
                     
    patchList.append('\x20\xff\xff') # 추가되는 폰트의 위치
    patchList.append('\x25\xc0') # 추가되는 폰트의 길이
    patchList.append(unhexlify(""))
                     
    return "".join(patchList)
    